import React from "react";
import {
  Form,
  FormControl,
  Navbar,
  Nav,
  NavItem,
  NavDropdown,
  MenuItem,
} from "react-bootstrap";
import Button from "react-bootstrap/Button";
import { BsCollectionFill } from "react-icons/bs";

const Navs = () => {
  return (
    <>
      <Navbar bg="green-500" variant="dark" expand="lg">
        <Navbar.Brand>
          {" "}
          <div className="flex">
            <h3 className="text-3xl text-purple-800">
              <BsCollectionFill />
            </h3>
            <h3 className=" ml-2 text-2xl md:text-2xl"> Student Portal</h3>
          </div>
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="mr-auto">
            <Nav.Link href="#home">Dashboard</Nav.Link>
            <Nav.Link href="#profile">Profile</Nav.Link>
            <Nav.Link href="#linsk">Courses</Nav.Link>
            <Nav.Link href="#lidnk">Results</Nav.Link>
            <Nav.Link href="#lifnk">Routine</Nav.Link>
          </Nav>
          <Button variant="outline-light" size="sm">
            LOGIN
          </Button>
        </Navbar.Collapse>
      </Navbar>
    </>
  );
};

export default Navs;
